import React from "react";
import Head from "next/head";
import AppLayout from "../components/AppLayout";

const Signup = () => {
  return (
    <>
      <Head>
        <title>회원 가입 | Nodebird</title>
      </Head>
      <AppLayout>
        <div> 회원 가입 </div>
      </AppLayout>
    </>
  );
};

export default Signup;
